        public delegate void RefAction<T>(ref T arg);

        public static Dictionary<string, RefAction<string>> fileMappings = new Dictionary<string, RefAction<string>> {
                    { "position", Position },
                    { "cash", Cash },
                    { "trade", Trade },
                    { "book", Book },
                    { "secmaster", SecMaster }
        };

        public static void ConvertDatToCsv(string sourceFilePath)
        {
            foreach (var entry in fileMappings)
            {
                if (sourceFilePath.Contains($"{entry.Key}.DAT"))
                {
                    string outputFilePath = Path.Combine(Program.outputFolder, $"{entry.Key}.csv");
                    if (File.Exists(outputFilePath)) File.Delete(outputFilePath);

                    string[] lines = File.ReadAllLines(sourceFilePath);
                    if (lines.Length == 0) return;

                    string headers = GetHeaders(entry.Key);
                    File.AppendAllText(outputFilePath, headers + Environment.NewLine);

                    for (int i = 1; i < lines.Length - 1; i++)
                    {
                        string modified = lines[i];
                        entry.Value(ref modified);
                        File.AppendAllText(outputFilePath, modified + Environment.NewLine);
                    }

                    // File.Delete(sourceFilePath);
                    break;
                }
            }
        }

